import React from "react";
import { useParams, useNavigate } from "react-router-dom";

const DisciplineLive = () => {
  const { eventName, disciplineName } = useParams();
  const navigate = useNavigate();

  return (
    <div className="p-4">
      {/* Tlačítko zpět */}
      <button onClick={() => navigate(`/event/${eventName}`)}>⬅️ Back to {eventName.replace(/-/g, " ")}</button>

      {/* Název disciplíny */}
      <h1 className="text-3xl font-bold mt-4">{disciplineName.replace(/-/g, " ")}</h1>
      <p className="text-gray-600">Live výsledky budou zde!</p>

      {/* Zde budeme načítat data z Google Sheets */}
    </div>
  );
};

export default DisciplineLive;
